  render() {
    return (
      <React.Fragment>
        <NavBar />
        {/* react-router-dom */}
        <ProductList/>
        <Routes>

          <Route path="/details" component={Details} />
          {/*<Route path="/cart" component={Cart} />
          <Route component={Default} />*/}
        </Routes>
        {/*<Modal />
        <Footer />*/}
      </React.Fragment>
    );
  }
}

export default App;
